import React, { useEffect, useState } from 'react';
import './Dashboard.css';
import axios from 'axios';

// Define ToggleButton component outside Dashboard component
const ToggleButton = ({ user }) => {
  const [isActive, setIsActive] = useState(user.is_active);

  const handleChange = async () => {
    try {
      
      const response = await axios.post("http://localhost:8002/api/user_IsActive", {
        userEmail: user.email,
        is_active: !isActive,
      });

      if (response.data.status) {
        setIsActive(!isActive);
        
      } else {
        alert('Failed to update status');
      }

    } catch (error) {
      console.error("Error updating user status:", error);
      alert('Error updating status');
    }
  };

  return (
    <div className="form-check form-switch">
      <input
        className="form-check-input"
        type="checkbox"
        checked={isActive}
        onChange={handleChange}
      />
      <label className="form-check-label"></label>
    </div>
  );
};

const Dashboard = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.post('http://localhost:8002/api/users');
        setUsers(response.data.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchUsers();
  }, []);

  console.log(users)
  return (
    <div className="dashboard">
      <header className="header">
        <h1>Dashboard</h1>
      </header>
      <nav className="sidebar">
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/">Analytics</a></li>
          <li><a href="/">Settings</a></li>
          <li><a href="/">Logout</a></li>
        </ul>
      </nav>
      <main className="main-content">
        <section className="section">
          <h2 className="table-heading">Table of Users</h2>
          <div className="table-container">
            <table className="table table-success table-striped">
              <thead>
                <tr>
                  <th scope="col">Sr.No</th>
                  <th scope="col">UserName</th>
                  <th scope="col">_id</th>
                  <th scope="col">Email-id</th>
                  {/* <th scope="col">Password</th> */}
                  <th scope="col">DOB</th>
                  <th scope="col">is_active</th>
                  <th scope="col">is_deleted</th>
                  <th scope="col">Role</th>
                </tr>
              </thead>
              <tbody>
                {users.length > 0 ? (
                  users.map((user, index) => (
                    <tr key={user._id}>
                      <th scope="row">{index + 1}</th>
                      <td>{user.userName}</td>
                      <td>{user._id}</td>
                      <td>{user.email}</td>
                      {/* <td>{user.password}</td> */}
                      <td>{user.DOB}</td>
                      <td>
                        <ToggleButton user={user} /> {/* Use ToggleButton component here */}
                      </td>
                      <td>
                        <div className="form-check form-switch">
                          <input
                            className="form-check-input"
                            type="checkbox"
                            checked={user.is_deleted}
                            readOnly
                          />
                          <label className="form-check-label"></label>
                        </div>
                      </td>
                      <td>{user.role}</td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="8" style={{ textAlign: 'center' }}>No users found</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;
